import React from 'react';
import Header from '../components/Header';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import '../css/Home.css';

function Home() {
    return (
        <>
            <Header />
            <Navbar />
            <main className="home-content">
                <h1>Welcome to Behnke's Goods!</h1>
                <p>Discover the latest and best products with unbeatable deals!</p>
            </main>
            <Footer />
        </>
    );
}

export default Home;
